import React from "react";
import { makeStyles } from "@material-ui/core/styles";
import { ThemeProvider } from "styled-components";
import { theme } from "../../GlobalStyle/theme";
import Image from '../../images/imagesMain';
import BurgerMenu from './BurgerMenu';
import backgroundImage from "../../images/background.jpeg";


const useStyles = makeStyles(theme => ({

  root: {
    '& .MuiTextField-root': {
      margin: theme.spacing(1),
      width: 200,
    }
  },
  submit: {
    margin: (theme.spacing(3, 0, 2), "10px"),
    display: "flex",
    backgroundColor: "#f50057",
    color: "#fafafa",
  },
  divSubmit: {
    display: "-webkit-inline-box",
    margin: "auto"
  }

}));

const Contato = () => {
  const classes = useStyles();
  return (<ThemeProvider theme={theme}>
    <>
      <BurgerMenu />
    </>
    <>
        <StyledMainDiv>
          <div className={classes.form}>
          <StyledOtherDiv>
          <h1>ENTRE EM CONTATO</h1>
          </StyledOtherDiv>
          <StyledOtherDiv>
            <p>Tem alguma dúvida, problema com o aplicativo ou quer nós da</p>
            <p>um feedback? Entre em contato conosco por email.</p>

            </StyledOtherDiv>
            <StyledOtherDiv>
   <span>contatonome@gmail.com</span>
   </StyledOtherDiv>
   <StyledOtherDiv>
        <Image/>
        </StyledOtherDiv>
        </div>
        </StyledMainDiv>

    </>
  </ThemeProvider>
  );
};

export default Contato;


const StyledMainDiv = styled.div`
  background-attachment: fixed;
  /* width: 320px; */
  align-content: center;
  align-items: center;
  vertical-align: middle;
  background-image: url(${backgroundImage});
  border-radius: 2px;
  padding: 30px 20px;
  margin: 0 auto;

  strong {
    font-size: 20px;
    text-align: center;
    display: block;
    color: ${({ theme }) => theme.primaryRed};
  }

  form {
    margin-left: auto;
    margin-right: auto;
  }

  button[type="submit"] {
    width: 100%;
    border: 0;
    margin-top: 30px;
    background: ${({ theme }) => theme.primaryRed};
    border-radius: 2px;
    padding: 15px 20px;
    font-size: 16px;
    font-weight: bold;
    color: ${({ theme }) => theme.primaryDark};
    cursor: pointer;
    transition: background 0.5s;
  }
`;

const StyledOtherDiv = styled.div`
  margin-top: 10px;

  input {
    width: 100%;
    height: 32px;
    font-size: 14px;
    color: grey;
    border: 0;
    border-bottom: 1px solid ${({ theme }) => theme.primaryDark};
  }

  label {
    color: #000;
    font-size: 14px;
    font-weight: bold;
    display: block;
  }

  a {
    text-align: center;
  }
`;
